28	71	2011-11-12 22:32:20.187574+00	f	Nicotiana Rustica Seeds (Aztec Tobacco)	Ornamental use only - not for consumption. Plant responsibly. \r\n\r\nNicotiana rustica, known in South America as Mapacho, is a plant in the Solanaceae family. It is a very potent variety of tobacco. The high concentration of nicotine in its leaves makes it useful for creating organic pesticides. \r\n\r\nRustica is also used for entheogenic purposes by South American shamans. Growing in the rainforest it contains up to twenty times more nicotine than common North American varieties such as N. tabacum. Other reasons for its shamanic use are the comparatively high levels of MAOI beta-carbolines, including harman and norharman. \r\n\r\nNicotiana Rustica has an extremely high nicotine content. The nicotine content can reach as high as 9% giving it some use as a natural organic pesticide. It produces millions of seeds, hundreds of small yellow to greenish flowers, and grows to about four feet tall. This is related to smoking tobacco, and has been used for the same purpose in the past.	post/2011/11/Nicotiana_Rustica_Mapacho_Tobacco_Seeds_Flower.jpg	f	96
29	71	2011-11-12 22:34:09.50742+00	f	Nicotiana Sylvestris Seeds	Nicotiana sylvestris is a species of wild tobacco known by the common names Woodland Tobacco and South American Tobacco. It is native to South America, and is often grown in gardens for its scented flowers. The scent is strongest at night, so as to attract pollinating moths. The leaves are simple, somewhat sticky, foul-smelling, with the blade partially surrounding the stem (clasping petiole). Flowers are tubular, white, borne in large clusters above the foliage. Flowers can be over 7 centimeters long with a face 2 centimeters wide. Each flower eventually produces a large quantity of small seeds.\r\n\r\n\r\n1000 Viable Nicotiana Sylvestris Seeds per packet Nicotiana sylvestris is a species of wild tobacco known by the common names Woodland Tobacco and South American Tobacco. It is native to South America, and is often grown in gardens for its scented flowers. The scent is strongest at night, so as to attract pollinating moths. The leaves are simple, somewhat sticky, foul-smelling, with the blade partially surrounding the stem (clasping petiole). Flowers are tubular, white, borne in large clusters above the foliage. Flowers can be over 7 centimeters long with a face 2 centimeters wide. Each flower eventually produces a large quantity of small seeds. This plant is thought to be one of the parents of Nicotiana tobacum, the plant used in modern tobacco production.	post/2011/11/5_6.jpg	f	96
