31	71	2011-11-12 22:37:11.606137+00	f	Verbascum thapsus (Great or Common Mullein) Seeds	A packet of 1000 seeds. \r\nGreat Mullein has been used since ancient times as a remedy for skin, throat and breathing ailments. It has long had a medicinal reputation, especially as an astringent and emollient, as it contains mucilage, several saponins, coumarin and glycosides. Dioscorides recommended it for diseases of the lung and it is now widely available in health and herbal stores. Non-medical uses have included dyeing and making torches. \r\nThe plant's leaves, in addition to the seeds, have been reported to contain rotenone, although quantities are unknown \r\nThis plant is a hairy biennial plant that can grow to 2 m or more tall. Its small yellow flowers are densely grouped on a tall stem, which bolts from a large rosette of leaves. It grows in a wide variety of habitats, but prefers well-lit disturbed soils, where it can appear soon after the ground receives light, from long-lived seeds that persist in the soil seed bank. It is a common weedy plant that spreads by prolifically producing seeds, but rarely becomes aggressively invasive, since its seed require open ground to germinate.		f	96
