149	343	2012-03-16 02:16:39.280399+00	f	Villages Quick Guide	villages > help\r\n\r\nThis is a brief guide to Villages and its terminology. \r\n[Work in Progress. Please send suggestions.]\r\n\r\nVillages is an online economic system with:\r\n- a social network of producers\r\n- a marketplace of ads and private messages\r\n- a payment system (credit clearing)\r\n- an alternative currency (mutual credit)\r\n\r\nIt is based on the Ripple web-based mutual credit clearing system. Ripple models how people actually extend each other varying amounts of credit based on experience and trust. Then it finds paths of trust to enable strangers to pay each other. So unlike LETS, there is no collectivized debt exposure requiring arbitrary administration.\r\n\r\nGLOSSARY  \r\nPost - ad or announcement\r\nHour - unit and name of currency (time-based, divided with decimals)\r\n\r\nEndorse - to extend a line of credit\r\nHeart - hour-unit of line of credit\r\n\r\nAcknowledge - to credit or pay \r\nTrusted - endorsed\r\nDirect - unendorsed\r\n\r\nHealth - a person's unused percentage of your endorsement. A simple credit rating.\r\nOverall Balance - total hours\r\nTrusted Balance - trusted hours\r\nReputation - total hearts with you, both directly and indirectly through a person's trusted paths to you in the network.\r\n\r\nWhen posting, use "Easy Categories". See next post or:\r\nhttps://villages.cc/posts/148/		f	457
