276	507	2012-10-25 04:41:26.591619+00	f	MOVEMBER	I am looking for 1 or 2 hour donations sponsorship for my effort to support Male health awareness. \r\n\r\nI am fundraising for http://ca.movember.com/about/ It is a month long race to grow the best moustache and raise awareness for Men's Health. \r\n\r\nFollow my progress at http://mobro.co/darinmbicknell. I will post in mospace if you donate through Villages. I will be working to promote Men's Health at every opportunity and I will get myself an appointment for a Men's Health Checkup as part of the spirit of Movember and as I am getting longer in the tooth it is time to get checked every year. \r\n\r\nSo any and all donations are welcome. 1 hour would be nice if I make it the whole the month without going nuts and shaving off the stache... and 2 hours if I also get my check up done in November.  http://ca.movember.com/mens-health/ .\r\n\r\nOVERVIEW OF MOVEMBER\r\n\r\nDuring November each year, Movember is responsible for the sprouting of moustaches on thousands of men’s faces, in Canada and around the world. With their “Mo’s”, these men raise vital funds and awareness for men's health, specifically prostate cancer and male mental health initiatives.\r\n\r\nOn Movember 1st, guys register at Movember.com with a clean-shaven face. For the rest of the month, these selfless and generous men, known as Mo Bros, groom, trim and wax their way into the annals of fine moustachery. Supported by the women in their lives, Mo Sistas, Movember Mo Bros raise funds by seeking out sponsorship for their Mo-growing efforts.\r\n\r\nMo Bros effectively become walking, talking billboards for the 30 days of November. Through their actions and words, they raise awareness by prompting private and public conversation around the often ignored issue of men’s health.\r\n\r\nAt the end of the month, Mo Bros and Mo Sistas celebrate their gallantry and valor by either throwing their own Movember party or attending one of the infamous Gala Partés held around the world by Movember, for Movember.  \r\n\r\nMovember - a global movement\r\n\r\nSince its humble beginnings in Melbourne Australia, Movember has grown to become a truly global movement inspiring more than 1.9 Million Mo Bros and Mo Sistas to participate with formal campaigns in Australia, New Zealand, the US, Canada, the UK, South Africa, Ireland, Finland, the Netherlands, Spain, Denmark, Norway, Belgium and the Czech Republic. In addition, Movember is aware of Mo Bros and Mo Sistas supporting the campaign and men’s health cause across the globe, from Russia to Dubai, Hong Kong to Antarctica, Rio de Janeiro to Mumbai, and everywhere in between.\r\n\r\nNo matter the country or city, Movember will continue to work to change established habits and attitudes men have about their health, to educate men about the health risks they face, and to act on that knowledge, thereby increasing the chances of early detection, diagnosis and effective treatment.\r\n\r\nIn 2011, over 854,000 Mo Bros and Mo Sistas around the world got on board, raising $125.7 million CAD.	post/2012/10/bICmov.jpg	f	670
