97	33	ontimon@hotmail.com	1	Perdón por no describir a este amigo personalizadamente como se merece. Lo haré dentro de poco.	Hola,\r\nTe invito a esta página que me parece muy interesante. En realidad creo que puede cambiar el mundo a largo plazo, pero veamos primero qué puede hacer por nosotros ahora.\r\nEl sitio te permite comprar cosas y sobre todo, servicios de otras personas sin necesidad de usar dinero.\r\nTampoco es gratis, tú también tienes que compartir tus habilidades con los demás.\r\nTe pongo un ejemplo, para que entiendas cómo funciona por dentro:\r\n\r\nAna es amiga de Bernardo, que es amigo de Carlos, que es amigo de David, que es muy bueno en matemáticas.\r\nAna no conoce a David, pero ve el anuncio en la página "clases de matemáticas" y David le da una clase.\r\nDavid le ha echo un favor a Carlos, que ha podido hacerle el favor a Bernardo de hacerle el favor a Ana.\r\nPero David le debía un favor a Carlos, así es que entre ellos dos no tienen cuentas abiertas.\r\nAna tiene un huerto y anuncia pimientos y patatas en la página. A Carlos le gusta la idea y decide saldar así el favor que le debe Bernardo, a quien a su vez le debe un favor Ana.\r\nNadie debe favores a nadie ahora.\r\nLuego Bernardo, que es muy bien cocinero, le prepara unos tuppers a David, que tiene poco tiempo para comer a medio día; Emilio es fotógrafo y ayuda a Bernardo a fotografiar sus platos; Felipe deja a su hijo en casa de David, que también le dá clases al niño; Gerardo no consigue cambiar el condenado timbre de su casa, que está estropeado y llama a su amigo Felipe, que es un manitas, etcétera.  \r\n\r\nAdemás de invitarte, te doy un corazón. Eso significa que me puedes "dejar a deber" (en cosas que me compres a mi o a amigos mios) hasta 1 hora.\r\nSí, no lo había dicho. Los favores se cuentan en horas, no en euros. Se supone que es una hora de trabajo no cualificado. Osea, seguramente el médico querrá cobrar más de 1 hora de la página por una hora de su trabajo. De cualquier manera, las dos partes tienen que estar de acuerdo en el "precio en horas" de cada favor.\r\nComo yo te he dado un corazón, tú puedes pagar a mis amigos, yo respondo por ti.\r\nAdemás, tus amigos me pueden pagar a mi. Te lo dirán: "te debo un favor, que el dice que confia en que tu le pagarás por mi". \r\nSi quieres que yo pueda pagar a tus amigos, puedes darme un corazón o varios a mi. El número de corazones indica el número máximo de horas.\r\nEso también permitirá que mis amigos puedan pagarte a ti. Si luego no quieres nada de ellos a cambio del favor que les hagas, yo te compensaré.\r\n\r\nDebería poneos un un mensaje personalizado sobre lo que hacéis bien y lo mucho que moláis, pero creo que voy a invitar a mucha gente para promover la página y no sé si muchos le vais a hacer siquiera caso a esto.\r\nA ver quién es el primero en dar o recibir un Acknowledgement (una hora).\r\nLa verdad es que hasta que no haya más gentecilla, parece difícil. Pero tenemos que intentarlo.\r\nUn comercio más justo y menos dependiente de los bancos es posible.\r\nDemos un primer pequeño paso.	2011-11-10 20:56:22.812544+00	geb9AN0iu9N9jRQsyRKb
