175	33	asolache@gmail.com	1		Hola, bienvenido a la página.\r\nTe pego aquí el texto que le he puesto a algunos amigos dentro de un ackowledgement para introducirlos en la página:\r\n\r\nMira, te pago (acknowledgement, reconocimiento) una hora para que veas cómo es.\r\nNormalmente aquí pondría algo como "me ha hecho tal favor". \r\nNormalmente tampoco podría pagarte, porque tú no no has indicado que confies en mi. Pero estoy haciendo un reconocimiento directo, que sería algo así como "te pago, aunque tú no aceptes esto como pago".\r\nLuego, por favor, devuélveme la hora, para que no se quede ahí que debo una hora más de las que realmente debo en mi total.\r\nPara pagarme tienes que pulsar meterte en mi perfil y pulsar "acknowledge" (izq)\r\n\r\nAhora como máximo tú me puedes deber a mi una hora, porque yo te he dado un endorsement (muestra de confianza, patrocinio) de 1 corazoncito.\r\nA ti no te puede deber nadie (salvo direct acknowledgements), porque tú todavía no confías en nadie.\r\nPara que la gente pueda pagarte a ti en horas de las que tu aceptas, tienes que confiar en alguien. Puedes confiar (dar corazoncitos) en personas que están ya registradas en la página entrando en su perfil y pulsando "Endorse" (izq).\r\nPuedes confiar en personas que no están registradas a la vez que las invitas pulsando "Invite a friend" (der).\r\nCada corazoncito representa una hora, cuantos más le des a una persona, más confianza muestras y más te compromentes por ella.\r\n\r\nComo yo confio en ti, Ryan confía en mi y los amigos de Ryan confían en éĺ, tú ya podrías pagar a todos ellos hasta una hora, que me deberías a mi.\r\nPero, por favor, espera un poco antes de hacerlo. Vamos a intentar primero hacer cosas por y recibir de gente que tenemos más cerca, porque localmente es mucho más fácil devolver favores. \r\n\r\nPuedes poner un anuncio pulsando "new post" (der). Para diferenciar si es algo que ofreces o que buscas, hay una casilla que debes marcar cuando el anuncio es por algo que buscas.\r\nPuedes ver los anuncios de otros si pulsas "feed" (izq) y después "Posts" (arriba)\r\nPregúntame si tienes alguna duda.	2011-11-21 17:58:51.727981+00	aRcl9QbPMRb2VSqUems6
